import React from "react"
import { stack as Menu } from "react-burger-menu";

function HamburgerMenu () {
    return (
        <Menu right> 
            <a href='#'>Number 1</a>
            <a href='#'>Number 2</a>
            <a href='#'>Number 3</a>
        </Menu>
    );
}

export default HamburgerMenu;
